let mobileMenu=document.getElementById("mobile-menu"),menuBruh=document.getElementById("menu-x");const menuX=()=>{menuBruh.classList.contains("fa-bars")?(menuBruh.classList.remove("fa-bars"),menuBruh.classList.add("fa-times")):(menuBruh.classList.remove("fa-times"),menuBruh.classList.add("fa-bars"))};